import React from 'react';
import ExperienceItem from '../components/ExperienceItem'; // Adjust the path as needed
import '../styles/Experience.css' // Adjust the path as needed

const Experience = () => {
  // Sample experience data (replace with your actual data)
  const experiences = [
    {
      title: 'Software Engineer',
      company: 'Awesome Company',
      date: 'May 2023 - Present',
      responsibilities: [
        'Develop and maintain web applications using React and Node.js',
        'Design and implement scalable and efficient APIs',
        'Collaborate with cross-functional teams to deliver high-quality features',
      ],
    },
    // Add more experience objects here
  ];

  return (
    <div className="experience-page">
      {experiences.map((experience, index) => (
        <ExperienceItem key={index} {...experience} />
      ))}
    </div>
  );
};

export default Experience;
